angular.module("netAwesome").run(["$templateCache",function(a){a.put("views/awesome.html",'<div class="awesome form-group">\n  <div ng-class="{\'input-group\': awesome.list.length > 1}">\n    <span\n      class="input-group-addon"\n      ng-repeat="step in awesome.list"\n      ng-class="{\'aw-item-add\': step.add}"\n      ng-if="$index > 0">\n      {{ step.name }} <i class="glyphicon glyphicon-remove aw-cancel-item" ng-click="awesome.cancelFilter($index)"></i>\n    </span>\n    <div class="aw-input form-control" contenteditable>\n      <div class="aw-placeholder">{{ awesome.placeholder }}</div>\n    </div>\n  </div>\n  <ul class="aw-list list-group" ng-show="awesome.show">\n  </ul>\n  <div class="modal fade" data-add="false" id="preAdd" tabindex="-1" role="dialog" aria-labelledby="add" aria-hidden="true">\n    <div class="modal-dialog">\n      <div class="modal-content">\n        <div class="modal-header">\n          <button type="button" class="close" data-dismiss="modal" aria-label="Close"><span aria-hidden="true">&times;</span></button>\n          <h4 class="modal-title"> Agregar item</h4>\n        </div>\n        <div class="modal-body">\n          Desea agregar <b>{{ awesome.list[awesome.list.length-1].name }}</b> a <b>{{ awesome.father.label }} </b>\n        </div>\n        <div class="modal-footer">\n          <button type="button" class="btn btn-default" data-dismiss="modal" ng-click="awesome.cancelAdd()">Cancelar</button>\n          <button type="button" class="btn btn-primary" ng-click="awesome.requestItem()">Agregar</button>\n        </div>\n      </div>\n    </div>\n  </div>\n</div>\n'),a.put("views/awesome.item.html",'<li class="list-group-item aw-item" ng-class="{active:$parent.awesome.select == $index, set: $index == 0}">\n    <span ng-transclude></span>\n</li>\n')}]);